import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import CreateEmployee  from  './employee/CreateEmployee';
import RetriveEmployee from './employee/RetriveEmployee'
import EditEmployee from './employee/EditEmployee'


function App() {
  return (
    <div className="App">
    <BrowserRouter>
          <Routes>
              <Route></Route>
              <Route exact path="/createEmployee" element={<CreateEmployee/>} />
              <Route exact path="/retriveEmployee" element={<RetriveEmployee/>} />
              <Route exact path="/editEmployee/:pkEmpId" element={<EditEmployee/>} />


          </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
